import React from 'react';
import './Footer.css';
import logoTwitter from '../logoTwitter.png'
import logoFacebook from '../logoFacebook.png'
import logoInstagram from '../logoInsta.png'

const footerScrubs = [
  {
    link: "http://www.facebook.com",
    logo: {logoFacebook}
  },
  {
    link: "https://twitter.com/login?lang=fr",
    logo: {logoTwitter}
  },
  {
    link: "https://instagram.com",
    logo: {logoInstagram}
  },
  {
    home: "Home"
  },
  {
    home: "Selected Profil"
  }, 
  {
    home: "My Account"
  },
  {
    home: "Legal Mentions"
  },
  {
    home: "Contact Us"
  },
] 



const Footer = () =>(
      <footer className="footerDistributed">
        {footerScrubs.map(footerScrub => (
        <React.Fragment>
        <div className="footerRight">
             <a className="footerIcon" href={footerScrub.link}><img className="footerImg"src={footerSrub.logo}/></a>
        </div> 

        <div className="footerLeft">  
           <p className="footerLinks">  
             <a href="home"> {footerSrub.home} </a>
             <a href="selected-profil"> {footerSrub.home}  </a>    
             <a href="my-account"> My Account </a> 
             <a href="legal-mentions"> Legal Mentions </a>
             <a href="contact"> Contact us </a>   
           </p> 
           <p> Scrub &copy; 2019 </p> 

         </div>
         </React.Fragment>
         ) )}    
      </footer>

)   


export default Footer;
